axios.defaults.headers.common["x-api-key"] = API_KEY;
axios.defaults.baseURL = "https://api.thecatapi.com/v1";

/**
 * 1. Create an async function "initialLoad" that does the following:
 * - Retrieve a list of breeds from the cat API using fetch().
 * - Create new <options> for each of these breeds, and append them to breedSelect.
 *  - Each option should have a value attribute equal to the id of the breed.
 *  - Each option should display text equal to the name of the breed.
 * This function should execute immediately.
 */
let breedSelection = document.getElementById("breedSelect");
let options = document.createElement("option");
//options.append.textContent = "WORKING";
//options.append.value = "test_id";
//breedSelection.appendChild(options);

async function initialLoad() {

  let response = await axios.get("/breeds");
  let breeds =  response.data;

  let allBreeds = breeds; // This is so we don't have to call the API so many times

//breeds

  for (let breed = 0; breed<allBreeds.length; breed++){
    let options = document.createElement("option");

    options.textContent = allBreeds[breed].name;
    options.value = allBreeds[breed].id;
    
    breedSelection.appendChild(options)
  }


}

initialLoad(); // runs the Breed selection
async function initalImage(){


  let response = await axios.get("/breeds");
  let breeds =  response.data;



 
  //let breeds = await response.json();
  let selectedBreed = breeds[1]
  let responseImage = await axios.get(`/images/${selectedBreed.reference_image_id}`);
  let image =  responseImage.data;

  let imageUrl = image.url;
    //Carousel.createCarouselItem(selectedBreed.reference_image_id, selectedBreed.name, selectedBreed.id);
    Carousel.clear();
    Carousel.appendCarousel(Carousel.createCarouselItem(imageUrl, selectedBreed.name, selectedBreed.id));
    Carousel.start();
    document.getElementById("infoDump").innerHTML = `<h4> ${selectedBreed.name}</h4><p><b> Grooming:</b> ${selectedBreed.grooming}</p><p> <b>Temperament:</b> ${selectedBreed.temperament}</p><p> <b>Health Issues:</b> ${selectedBreed.health_issues}</p><p><b> Life Span: </b>${selectedBreed.life_span}</p>`;
